@font-face {
    font-family: roboto;
    src: url('bcc3453643980c72f35684516709adf4.ttf');

}

@font-face {
    font-family: economica;
    src: url('f17271936c78ae1ec15f283512a9e27d.ttf');
}

body {
    text-align: center;
    font-size: 20px;
    padding: 2.5%;
    font-family: roboto;
}

.button {
    font-size: 15px;
}

h1,h2,h3,h4,h5 {
    font-family: economica;
}   

.profilePic {
    width: 180px;
    height: 180px;
    border-radius: 90px;
}

.title-fade-in {
    opacity: 0;   
    animation-name: fade-in;
    animation-duration: 2s;
}

.title-fade-out {
    opacity: 100;
    animation-name: fade-out;
    animation-duration: 2s;
}

@keyframes fade-in {
    from {opacity: 0;}
    to {opacity: 100;}  
}

@keyframes fade-out {
    from {opacity: 100;}
    to {opacity: 0;}
}

.header {
    display: inline-block;
    margin: 20px;
    margin-bottom: 50px;
}
